  const items = [
      {'image': 'tshirt.png',
       'name': 'blue tshirt',
       'price': '£37'},
       {'image': 'tshirt2.png',
       'name': 'red tshirt',
       'price': '£36'},
       {'image': 'tshirt3.png',
       'name': 'green tshirt',
       'price': '£38'}
      ]

   return (
    <div className="container">
        { 
          items.map( 
            item => <ItemTile />
          )
        }
    </div>
  );
}
